style.css:
/* Example Stylish CSS */

/* Change background color of the webpage */
body {
    background-color: #f5f5f5 !important;
}

/* Change text color of headings */
h1, h2, h3, h4, h5, h6 {
    color: #333 !important;
}

/* Increase font size of paragraphs */
p {
    font-size: 16px !important;
}

/* Add a border around images */
img {
    border: 2px solid #ccc !important;
    border-radius: 5px !important;
}

/* Customize links */
a {
    color: #007bff !important; /* blue color */
    text-decoration: none !important;
    transition: color 0.3s ease-in-out !important;
}

a:hover {
    color: #0056b3 !important; /* darker blue on hover */
}
